import React from 'react';

function App() {
  const list = [{
    title: "Halloween",
    director: "John Carpenter",
    releaseYear: 1978,
    id: 1
  },
  {
    title: "It",
    director: "Andres Muschietti",
    releaseYear: 2017,
    id: 2
  },
  {
    title: "A Nightmare on Elm Street",
    director: "Wes Craven",
    releaseYear: 1984,
    id: 3
  },
  {
    title: "Hereditary",
    director: "Ari Aster",
    releaseYear: 2018,
    id: 4
  },
  {
    title: "Psycho",
    director: "Alfred Hitchcock",
    releaseYear: 1960,
    id: 5
  }
  ]

  return (
    <div style={{ textAlign: 'center' }}>
      <h1>
        Horror Classics:
      </h1>

      <ul>
        { list.map(function(movie) {
           return (
            <li key = {movie.objectID}>
              <span> <b>{movie.title}</b> </span>
              <span> directed by <b>{movie.director}</b> </span>
              <span> released in <b>{movie.releaseYear}</b> </span>
            </li>
           )
          })
        }
      </ul>
    </div>
  );
}

export default App;
